import React from 'react';
import { useState, useEffect } from "react";
import cardData from "../../card.json";

/**
* @author
* @function Cardlist
**/

const Cardlist = (props) => {

  return(
    <div>Cardlist
        {cardData.map((cardList,index) => {
            return <h2>{cardList.title}</h2>
        })}
    </div>

   );
 }


export default Cardlist
